import React from 'react';
import '../../App.css';
import './Pages.css';


function About()
{
	return (
		<div className='contentArea'>
		<div className='container-fluid'>
			<div className='row'>
				<div className='col-md-12'>
					<h1>Letter to Our Shareholders</h1>
				</div>
			</div>
		</div>
		</div>
	);
}

export default About;
